const [formData, setFormData] = useState({
  name: '',
  email: '',
  message: ''
});

const handleChange = (e) => {
  setFormData({ ...formData, [e.target.name]: e.target.value });
};

const handleSubmit = async (e) => {
  e.preventDefault();
  console.log(formData, 'formdata triggered');
  console.log('USER_MAIL:', process.env.USER_MAIL);
  console.log('USER_PASS:', process.env.USER_PASS);
  try {
    const response = await fetch('/api/contact', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(formData)
    });
    console.log(response,"response darta")

    if (response.ok) {
      // Email sent successfully
      alert('Your message has been sent!');
      setFormData({
        name: '',
        email: '',
        message: ''
      });
    } else {
      // Error sending email
      alert('Oops! Something went');
    }
  } catch (error) {
    console.error('Error sending message:', error);
    alert('Oops! Something went wrong. Please try again later.');
  }
};



  const [svgWidth, setSvgWidth] = useState(getSvgWidth());

  function getSvgWidth() {
    if (typeof window !== "undefined" && window.innerWidth) {
      const screenWidth = window.innerWidth;
      let percentage;
      if (screenWidth <= 375) {
        percentage = 500; // Set SVG width to 500% for screens 375px or smaller
      } else if (screenWidth >= 1200) {
        percentage = 100; // Set SVG width to 100% for screens 1200px or larger
      } else {
        percentage = Math.round(
          500 - ((screenWidth - 375) / (1200 - 375)) * 400
        ); // Linear mapping between 500% to 100%
      }

      return `${percentage}%`;
    }
  }

